import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {

    const getquestionid = (id) =>  {
        console.log("pressed");
        return props.questions.find(q => q.id === id); 

     }


    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.title}</p>
            <p>{q.category}</p>
        </Paper>
    )
}

export default Question;
